import Task from "./Task"

const Tasks = ({tasks , onDelete , toggle}) => {
    return (
        <>
            {tasks.map((task) => (
                <Task task={task} onDelete={onDelete} key={task.id}/>
            ))}
        </>
    )
} 

export default Tasks
